lemma eq_of_le_of_le (a b : ℝ≥0∞) (hab : a ≤ b) (hab': b ≤ a) : a = b  := by
  by_contra h;
  apply h;
  exact ⟨hab, hab'⟩

lemma rpow_add_of_pos (a : ℝ≥0∞) (c d : ℝ) (hc : c > 0) (hd : d > 0):
    a ^ (c + d) = a ^ c * a ^ d  := by
  rcases eq_or_ne a 0 with rfl | ha;
  rw [zero_rpow_of_pos (add_pos hc hd), zero_rpow_of_pos hc, zero_rpow_of_pos hd, mul_zero];
  rcases eq_or_ne a ⊤ with rfl | ha';
  rw [top_rpow_of_pos (add_pos hc hd), top_rpow_of_pos hc, top_rpow_of_pos hd, top_mul_top];
  exact ENNReal.rpow_add c d ha ha'

lemma rpow_add_of_pos (a : ℝ≥0∞) (c d : ℝ) (hc : c > 0) (hd : d > 0):
    a ^ (c + d) = a ^ c * a ^ d  := by
  rcases eq_or_ne a 0 with rfl | h;
  simp [zero_rpow_of_pos hc, zero_rpow_of_pos hd, zero_rpow_of_pos (by linarith)];
  rcases eq_or_ne a ⊤ with rfl | h';
  simp [top_rpow_of_pos hc, top_rpow_of_pos hd, top_rpow_of_pos (by linarith)];
  exact ENNReal.rpow_add c d h h'

